import React from "react";
import { AiOutlineCloseCircle } from "react-icons/ai";
import "./windowcard.styles.css";

export const WindowCard = ({ opts }) => {
  const { width, height, qty, notes, id } = opts;

  const price = () => {
    return width * height * 0.085;
  };

  return (
    <div className="windowcard-container">
      <AiOutlineCloseCircle className="close-icon" />
      {/* <h3 className="window-id">{id}.</h3> */}
      <h3 className="window-width">Width: {width}</h3>
      <h3 className="window-height">Height: {height}</h3>
      <h3 className="window-qty">Qty: {qty}</h3>
      <button className="window-notes">NOTES</button>
      <h3 className="window-price">Price: {qty}</h3>
    </div>
  );
};
